import { Component } from "react";
import "./Navbar.css";

class Navbar extends Component{
    render(){
        return(
            <nav className="NavbarItems">
              <h1 className="navrbar-logo">Internexus</h1>
              <ul className="nav-menu">
                <li>
                    <link>
                    <i class="fa-solid fa-house-user"></i>  Home</link>
                </li>
              </ul>
            </nav>
        )
    }
}
